VALUES ('4600756103084', 'Кулич пасхальный', 'мука пшеничная хлебопекарная высшего сорта, сахар-песок, вода питьевая, маргарин (дезодорированные растительные масла, вода питьевая, соль поваренная пищевая, эмульгатор E471, регулятор кислотности (кислота лимонная), ароматизатор «Масло», краситель (E100, E160B)), изюм, кондитерская глазурь (сахар, заменитель масла какао, молоко обезжиренное сухое, сыворотка молочная сухая, эмульгатор (лецитин), ароматизатор (ванилин)), яйца куриные, дрожжи хлебопекарные, кондитерская декоративная посыпка (сахар, крахмал кукурузный, растительное масло, лецитин, декстроза, ароматизатор-ванилин, E904, _пищевые красители_ (E10?, E110, E122, E124, E133), молоко сухое цельное, соль поваренная пищевая, улучшитель хлебопекарный (высушенная пшеничная мука, стабилизатор - карбонат кальция, эмульгатор E472e, антиокислитель - аскорбиновая кислота, ферменты (амилаза, гемицеллюлоза)), ароматизатор: ванилин.', '', '9', '', '63', '', '', '7', '', '', '', '1');

